INSERT INTO `v1_0666abf13d1d2897768c56a5e2497a724b38f8db6e3ac8ccd04d82030c895462` VALUES (0, 0, 2, "春咲 ひより", "ヒヨリでっす♪\n元気いっぱいがんばるよ♪", 1, 0, "お！\nあそこに困ってそうな人発見！", 1001, 0, 0, "ねぇねぇ、騎士クン\n手伝ってあげようよ～", 1, 1, 1.4);
INSERT INTO `v1_0666abf13d1d2897768c56a5e2497a724b38f8db6e3ac8ccd04d82030c895462` VALUES (0, 0, 2, "草野 優衣", "みんなみたいに\nわたしも強くならなきゃ", 1, 0, "大切な人を\n守れるようになりたい…って", 1002, 0, 0, "わ、わたし、\nなに言ってるんだろ\nあはは…", 1, 1, 1.4);
INSERT INTO `v1_0666abf13d1d2897768c56a5e2497a724b38f8db6e3ac8ccd04d82030c895462` VALUES (0, 0, 2, "士条 怜", "フェンシングを始めてみては？", 1, 0, "キミに必要な集中力と感性が", 1003, 0, 0, "少しは磨かれると思いますよ。", 1, 1, 1.4);
INSERT INTO `v1_0666abf13d1d2897768c56a5e2497a724b38f8db6e3ac8ccd04d82030c895462` VALUES (0, 0, 2, "穂高 みそぎ", "ねぇ、にいちゃん！", 1, 0, "今日はなにして遊ぶ？", 1004, 0, 0, "みそぎはねぇ、\nかくれんぼやりたい！", 1, 1, 1.5);
INSERT INTO `v1_0666abf13d1d2897768c56a5e2497a724b38f8db6e3ac8ccd04d82030c895462` VALUES (0, 0, 2, "風宮 あかり", "風宮あかりです", 1, 0, "ねぇ…", 1006, 0, 0, "私といっしょに…\nいかない？", 1, 1, 1.4);
INSERT INTO `v1_0666abf13d1d2897768c56a5e2497a724b38f8db6e3ac8ccd04d82030c895462` VALUES (0, 0, 2, "出雲 宮子", "出雲宮子なのー", 1, 0, "プリンたべたいのー", 1007, 0, 0, "食べ物の恨みは怖いのー", 1, 1, 1.5);
INSERT INTO `v1_0666abf13d1d2897768c56a5e2497a724b38f8db6e3ac8ccd04d82030c895462` VALUES (0, 0, 2, "虹村 雪", "ボクは虹村雪。", 1, 0, "キミもボクの美貌に\n吸い寄せられたんだね。", 1008, 0, 0, "いいよ。\n見られることは運命さ…", 1, 1, 1.4);
INSERT INTO `v1_0666abf13d1d2897768c56a5e2497a724b38f8db6e3ac8ccd04d82030c895462` VALUES (0, 0, 2, "柊杏奈", "フッ…聞いて後悔するがいい！", 1, 0, "我が真名は\nアンネローゼ・フォン・シュテッヒパルム！", 1009, 0, 0, "人呼んで「疾風の冥姫」!!", 1, 1, 1.4);
INSERT INTO `v1_0666abf13d1d2897768c56a5e2497a724b38f8db6e3ac8ccd04d82030c895462` VALUES (0, 0, 2, "姫宮 真歩", "マホマホ王国のプリンセス、\nまほ姫どす", 1, 0, "うさぎさん、\n運命の王子はんに巡りあわせてくれて", 1010, 0, 0, "ほんまおおきにやわ～♪", 1, 1, 1.5);
INSERT INTO `v1_0666abf13d1d2897768c56a5e2497a724b38f8db6e3ac8ccd04d82030c895462` VALUES (0, 0, 2, "衣之咲 璃乃", "衣之咲璃乃です！", 1, 0, "生き別れたお兄ちゃんを探して\n三千世界！", 1011, 0, 0, "ここで会ったが\n100年目～！", 1, 1, 1.4);
INSERT INTO `v1_0666abf13d1d2897768c56a5e2497a724b38f8db6e3ac8ccd04d82030c895462` VALUES (0, 0, 2, "柏崎 初音", "私はハツネ、\n結構強いんだよ。\nきらーん☆", 1, 0, "ち、超能力って…\n何のことかな～？", 1012, 0, 0, "…って、お願い！\n誰にも言わないでおいて～！", 1, 1, 1.4);
INSERT INTO `v1_0666abf13d1d2897768c56a5e2497a724b38f8db6e3ac8ccd04d82030c895462` VALUES (0, 0, 2, "美波 鈴奈", "ちょす！\n美波鈴奈だよ～♪", 1, 0, "一応カリスマ読モJKやってまっす！", 1016, 0, 0, "ヒデサイまぢ\nGF（グッドフィーリング）～♪", 1, 1, 1.4);
INSERT INTO `v1_0666abf13d1d2897768c56a5e2497a724b38f8db6e3ac8ccd04d82030c895462` VALUES (0, 0, 2, "喜屋武 香織", "はいたーい。\n喜屋武香織さー。", 1, 0, "東京は遊園地みたいなところさー", 1017, 0, 0, "でも、沖縄もとってもいいとこさー", 1, 1, 1.4);
INSERT INTO `v1_0666abf13d1d2897768c56a5e2497a724b38f8db6e3ac8ccd04d82030c895462` VALUES (0, 0, 2, "支倉 伊緒", "支倉伊緒です。", 1, 0, "先生って呼ばれるのは\nくすぐったいから", 1018, 0, 0, "イオちゃんって呼んでね。", 1, 1, 1.4);
INSERT INTO `v1_0666abf13d1d2897768c56a5e2497a724b38f8db6e3ac8ccd04d82030c895462` VALUES (0, 0, 2, "茜 ミミ", "ふえ…？\nミミ、むずかしいこと\nよくわかんない…", 1, 0, "あ！/\お兄ちゃ～ん\nまってよ～", 1020, 0, 0, "ミミをおいてかないでぇ～", 1, 1, 1.5);
INSERT INTO `v1_0666abf13d1d2897768c56a5e2497a724b38f8db6e3ac8ccd04d82030c895462` VALUES (0, 0, 2, "栗林 くるみ", "あ…あの…えっと…\n栗…林…くるみ…です……", 1, 0, "あの……\nふぇ……", 1021, 0, 0, "ふぇぇぇぇぇん……", 1, 1, 1.5);
INSERT INTO `v1_0666abf13d1d2897768c56a5e2497a724b38f8db6e3ac8ccd04d82030c895462` VALUES (0, 0, 2, "風宮 より", "風宮よりです。\nあああああ！", 1, 0, "こんな私に貴重な時間を\n割いていただき、", 1022, 0, 0, "なんてありがとうございます！", 1, 1, 1.4);
INSERT INTO `v1_0666abf13d1d2897768c56a5e2497a724b38f8db6e3ac8ccd04d82030c895462` VALUES (0, 0, 2, "北条 綾音", "私、アヤネ！\nぷうきちと一緒についてってあげるね！", 1, 0, "おにいちゃんどこいくの？\nえ？", 1023, 0, 0, "私こっち行きたいー\nね、早く早くー", 1, 1, 1.5);
INSERT INTO `v1_0666abf13d1d2897768c56a5e2497a724b38f8db6e3ac8ccd04d82030c895462` VALUES (0, 0, 2, "天野 すずめ", "わっ…わっ…私、\n天野すずめといいます！", 1, 0, "ふ、不束者ですが\nどうぞ末永く…って、", 1025, 0, 0, "これて何か違う…\nあああすみません！", 1, 1, 1.4);
INSERT INTO `v1_0666abf13d1d2897768c56a5e2497a724b38f8db6e3ac8ccd04d82030c895462` VALUES (0, 0, 2, "倉石 恵理子", "……クスクス…私は\n…倉石恵理子……", 1, 0, "あなたは…運命の……\n伴侶……", 1027, 0, 0, "離しませんわ………\n絶対に…!!", 1, 1, 1.4);
INSERT INTO `v1_0666abf13d1d2897768c56a5e2497a724b38f8db6e3ac8ccd04d82030c895462` VALUES (0, 0, 2, "佐々木 咲恋", "佐々木咲恋よ。\nねえ、世の中に無駄なことが\n多すぎると思わない？", 1, 0, "その無駄を省くことができれば、\nもっと余裕のある暮らしができるっ！", 1028, 0, 0, "…そうでしょ？？", 1, 1, 1.4);
INSERT INTO `v1_0666abf13d1d2897768c56a5e2497a724b38f8db6e3ac8ccd04d82030c895462` VALUES (0, 0, 2, "桜井 望", "桜井望だよ！\nよろしくねっ", 1, 0, "ぇっと…\nキミ、私のこと知らないの?!", 1029, 0, 0, "あはは、\n私もまだまだだなぁ～", 1, 1, 1.4);
INSERT INTO `v1_0666abf13d1d2897768c56a5e2497a724b38f8db6e3ac8ccd04d82030c895462` VALUES (0, 0, 2, "ニノン・ジュベール", "デケデケデンっ！", 1, 0, "初めまして、\n私はニノン・ジュベール申すデス！", 1030, 0, 0, "ショーグン、\nワタシと一緒に天下統一デース！", 1, 1, 1.4);
INSERT INTO `v1_0666abf13d1d2897768c56a5e2497a724b38f8db6e3ac8ccd04d82030c895462` VALUES (0, 0, 2, "上喜 しのぶ", "上喜しのぶです。\n手元のドクロが父です。", 1, 0, "でもって私の隣にいるのが……\nえ、見えない？", 1031, 0, 0, "おかしいですね……", 1, 1, 1.4);
INSERT INTO `v1_0666abf13d1d2897768c56a5e2497a724b38f8db6e3ac8ccd04d82030c895462` VALUES (0, 0, 2, "野戸まひる", "目指すはビッグな\nお笑い芸人だっぺ！", 1, 0, "けんども\nそれには足りないモンが…", 1033, 0, 0, "そう、\nオラのボケに突っ込める相方が…！", 1, 1, 1.5);
INSERT INTO `v1_0666abf13d1d2897768c56a5e2497a724b38f8db6e3ac8ccd04d82030c895462` VALUES (0, 0, 2, "綾瀬 ゆかり", "あの…私…綾瀬ゆかりです…\nあの…ごめんなさい！", 1, 0, "ちょっと緊張しちゃって…", 1034, 0, 0, "ちょ\nちょっと一杯飲んできます…！", 1, 1, 1.4);
INSERT INTO `v1_0666abf13d1d2897768c56a5e2497a724b38f8db6e3ac8ccd04d82030c895462` VALUES (0, 0, 2, "氷川 鏡華", "氷川鏡華…です", 1, 0, "知らない人とは話しちゃいけないので", 1036, 0, 0, "これ以上お話しすることは…\nないです！", 1, 1, 1.5);
INSERT INTO `v1_0666abf13d1d2897768c56a5e2497a724b38f8db6e3ac8ccd04d82030c895462` VALUES (0, 0, 2, "柏崎 栞", "柏崎…栞です。", 1, 0, "……あ、アラーム。", 1038, 0, 0, "私体が弱いから、\n30分に一度休憩しないと\nいけないんです。", 1, 1, 1.4);
INSERT INTO `v1_0666abf13d1d2897768c56a5e2497a724b38f8db6e3ac8ccd04d82030c895462` VALUES (0, 0, 2, "双葉 碧", "ふ、双葉碧です。", 1, 0, "私、一人も友達がいなくて……", 1040, 0, 0, "野に咲く花が、\n唯一の話相手です。", 1, 1, 1.4);
INSERT INTO `v1_0666abf13d1d2897768c56a5e2497a724b38f8db6e3ac8ccd04d82030c895462` VALUES (0, 0, 2, "三角 千歌", "三角千歌です。", 1, 0, "私の歌声で、\n皆さんが幸せになってくれたらいいなって…", 1042, 0, 0, "そう思っています。", 1, 1, 1.4);
INSERT INTO `v1_0666abf13d1d2897768c56a5e2497a724b38f8db6e3ac8ccd04d82030c895462` VALUES (0, 0, 2, "安芸 真琴", "安芸真琴だ。", 1, 0, "あぁ？\nお前のそいつの仲間か？", 1043, 0, 0, "う、疑ってすまなかったな…", 1, 1, 1.4);
INSERT INTO `v1_0666abf13d1d2897768c56a5e2497a724b38f8db6e3ac8ccd04d82030c895462` VALUES (0, 0, 2, "イリヤ・オーンスタイン", "わらわこそは夜を総べる者！", 1, 0, "生けとし生ける全ての者よ！", 1044, 0, 0, "わらわの偉大な力に\nひれ伏すがいい！\nはっはっは！", 1, 1, 1.4);
INSERT INTO `v1_0666abf13d1d2897768c56a5e2497a724b38f8db6e3ac8ccd04d82030c895462` VALUES (0, 0, 2, "遠見 空花", "そこで騎士は妖精を乱暴に……", 1, 0, "ぐふふふふ……はっ！", 1045, 0, 0, "ｌク、クウカに何かご用ですか!?", 1, 1, 1.4);
INSERT INTO `v1_0666abf13d1d2897768c56a5e2497a724b38f8db6e3ac8ccd04d82030c895462` VALUES (0, 0, 2, "宮坂たまき", "宮坂たまきにゃ♪\n猫はいいにゃよ？", 1, 0, "自由気ままで♪\n寝て遊んで、食べてケンカして…", 1046, 0, 0, "う～ん…\n猫ってホントに最高にゃ～♪", 1, 1, 1.4);
INSERT INTO `v1_0666abf13d1d2897768c56a5e2497a724b38f8db6e3ac8ccd04d82030c895462` VALUES (0, 0, 2, "大神 美冬", "大神美冬よ！", 1, 0, "それでは早速クエストに…", 1048, 0, 0, "…と思ったら\nバイトの時間だ！\nまたあとでね！", 1, 1, 1.4);
INSERT INTO `v1_0666abf13d1d2897768c56a5e2497a724b38f8db6e3ac8ccd04d82030c895462` VALUES (0, 0, 2, "星野静流", "星野静流だよ！", 1, 0, "クエストもバトルも\n掃除も洗濯も", 1049, 0, 0, "お姉ちゃんがぜ～んぶ\nやってあげるからね！", 1, 1, 1.4);
INSERT INTO `v1_0666abf13d1d2897768c56a5e2497a724b38f8db6e3ac8ccd04d82030c895462` VALUES (0, 0, 2, "玉泉美咲", "アタシは玉泉美咲。", 1, 0, "見ての通りの\nセクシー美少女で", 1050, 0, 0, "学校では誰もが憧れる\nアイドル的な存在ってやつよ♪", 1, 1, 1.5);
